--------------------------------------------------------
--  DDL for Trigger TRIGGER_ITEM_DELETE
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE TRIGGER "C##ITSTOCK"."TRIGGER_ITEM_DELETE" 
BEFORE UPDATE 
  OF DELETED
  ON ITEMS
  FOR EACH ROW

BEGIN
IF :NEW.DELETED = '1' THEN
  DELETE FROM ITEMSPECVALUES WHERE ITEM_ID = :OLD.ID;
  UPDATE RECORDS SET DELETED = 1 WHERE ITEM_ID = :OLD.ID; 
  :NEW.LABEL := '!$#' || :OLD.LABEL || '!$#' || :OLD.ID;
  :NEW.SERIAL_NUMBER := '!$#' || :OLD.SERIAL_NUMBER || '!$#' || :OLD.ID;
END IF;
END;
/
